import React, { Component } from 'react';
import './Styles/Products.css'

class Products extends Component {
    render() {
        return (
            <div id="Products">
                <h1 id="ProductsHeading">Products</h1>
                <div id="ProductImages">
                    <div className="ProductImage" id="ProductImage1"><p>Septic Tanks</p></div>
                    <div className="ProductImage" id="ProductImage2"><p>Windows</p></div>
                    <div className="ProductImage" id="ProductImage3"><p>Tiles</p></div>
                </div>
            </div>
        );
    }
}

export default Products;
